To determine how much money Linda, Sherry, June, and Connie have together, we need to add up their individual amounts:

\[
27.47 + 35.23 + 37.37 + 26.52
\]

Let's add these amounts step by step:

First, add Linda's and Sherry's amounts:
\[
27.47 + 35.23 = 62.70
\]

Next, add June's amount to the result:
\[
62.70 + 37.37 = 100.07
\]

Finally, add Connie's amount to the result:
\[
100.07 + 26.52 = 126.59
\]

So, the total amount of money they have together is \$126.59.

To find out how much money they have in excess of their target of \$100, we subtract \$100 from the total amount they have:

\[
126.59 - 100 = 26.59
\]

Therefore, the amount of money they have in excess  of their target is \( oxed{26.59}\).{
